import React, { useState } from "react";
import './Item.css';
import 'animate.css'

function Item(props){
    const [shake,setshake]=useState(false);
    function handleclass(){
        setshake(true);
    }
    return(
        <div className="title animate__animated animate__zoomIn"onMouseOver={handleclass}>
        <a className="animate__animated animate__shakeX" href={props.link}>{props.title}</a>
        </div>
    )
}

export default Item;
